         "The App allows the user to take images of machines or other assets as part of using the Maximo Application Suite of software. While this App is designed for images solely of assets, background may be inadvertently included. Accordingly, you must ensure you have all necessary permissions to take and use the images, including but not restricted to, permission to take images in the area in which you are working. You are solely responsible for the images, voice recordings, annotations and the like which are taken by the App and used by the Authorized Programs." : "[vagão do metrô~The App allows the user to take images of machines or other assets as part of using the Maximo Application Suite of software. While this App is designed for images solely of assets, background may be inadvertently included. Accordingly, you must ensure you have all necessary permissions to take and use the images, including but not restricted to, permission to take images in the area in which you are working. You are solely responsible for the images, voice recordings, annotations and the like which are taken by the App and used by the Authorized Programs.]",
