         "We use this information to develop internal marketing and business intelligence. For example, we may:" : "[vagão do metrô~We use this information to develop internal marketing and business intelligence. For example, we may:]",
         "    Combine the information collected to better understand your interests and potential business needs, such as IBM events you attend, content you review, or any of our websites that you visit." : "[vagão do metrô~    Combine the information collected to better understand your interests and potential business needs, such as IBM events you attend, content you review, or any of our websites that you visit.]",
